import React from 'react';

function AboutUsComponent(props) {
  // Accessing the AboutUsData array from props
  const aboutUsData = props.aboutUsData;

  // Rendering the AboutUs data
  return (
    <div>
      {aboutUsData.map((data, index) => (
        <div key={index}>
          <h1>{data.heading}</h1>
          <h2>{data.subHeading}</h2>
          <p>{data.content}</p>
          <button>{data.btn}</button>
        </div>
      ))}
    </div>
  );
}

export default AboutUsComponent;
